import ReactDOM from "react-dom";
import App from "./App";
import { Provider } from "react-redux";

import "./index.css";
import store from "./redux/store";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Provider store={store}>
    <App/>
  </Provider>
);
